import base64

import numpy as np
import scipy.io.wavfile as spw

import matplotlib.pyplot as pp

s = ' '

print(len(s))
result = base64.b64decode(s + '=========')
# print(base64.b64decode(s + '=='))
# print(bytes(result))

int_array = []
for b in result:
    int_array.append((b + 20) % 256)

print(int_array)

pp.plot(int_array)
pp.show()

to_wav = np.array(int_array, np.dtype(np.uint8))

path = 'test.wav'

spw.write(path, 8000, to_wav)
# spw.write('test.wav', 800, to_wav)

wav_string = ""
with open(path, "rb") as mywav:
    wav_string = base64.b64encode(mywav.read()).decode('ascii')

html_result = '''
<html>
<head>
<title>Audio Encoding Test</title>
</head>
<body>
    <audio controls>
        <source src="data:audio/wav;base64, {0}" >
        Your browser message.
    </audio>
</body>
</html>
'''.format(wav_string)
def request_handler(request):
    return html_result

